import React from "react";
import s from './Posts.module.css'
import PostElement from "./PostElement/PostElement";
const Posts = (props) => {


    let postElements = props.state.map (p => <PostElement id={p.state.id} message={p.state.message} likesCount={p.state.likesCount} />)

    return (
        <div>
            <div>
                <input type="textarea" />
                <button type="submit">Send</button>

            </div>
            <span className={s.span}>
                {s.postElements}
            </span>
        </div>
    )
}

export default Posts
